import styled from 'styled-components';

export const AboutContainer = styled('div')`
    width: 100%;
    height: auto;
`

export const InsideParallax = styled('div')`
    display: flex;
    flex-direction: column;
    align-items: center;
`;

export const Row = styled('div')`
    display: flex;
    flex-direction: row;
    align-items: center;
    justify-content: center;
    width: 100%;
    margin: auto;
    flex-wrap: wrap;
`;

export const TitleContainer = styled('div')`
    margin: 10px 0px;
    width: 100%;
    text-align: center;
`;

export const AboutMe = styled('div')`
    height: auto;
`

